import React from 'react'
import Cam from '../img/video-camera.png'
import Add from '../img/add-friend.png'
import More from '../img/more.png'
const chat = () => {
  return (
    <div className='chat'>
      <div className="chatinfo">
        <span>jane</span>
        <div className="chaticons">
          <img src={Cam} alt="" />
          <img src={Add} alt="" />
          <img src={More} alt="" />
        </div>
      </div>
    </div>
  )
};

export default chat;
